import React,{useEffect} from "react";
import M from "materialize-css/dist/js/materialize.min.js";
import {
    BrowserRouter as Router,
    Switch,
    Route,
    Link
  } from "react-router-dom";


const MobileNav = () => {


    const handleCloseNav = () => {
        let sidenav = document.querySelector("#slide-out");
        let instance = M.Sidenav.getInstance(sidenav);
        instance.close();



      };

      const handleOpenNav = () => {
        let sidenav = document.querySelector("#slide-out");
        let instance = M.Sidenav.getInstance(sidenav);
        instance.open();

      }


    return (
        <div>

         <a href="#!"
        data-target="slide-out"
        className="sidenav full hide-on-large-only"
       style={{cursor: 'pointer',transform:'translateX(-100%)'}}
      >
        <i className="material-icons medium">menu</i>

      </a>
      <ul id="slide-out" className="sidenav">
        <a href="#!" data-target="slide-out">
          <i className="material-icons  medium" onClick={handleCloseNav}>close</i>
        </a>

        <li>
        <a href="/">Home</a>

        </li>
        <li>
          <div className="divider"></div>
        </li>
        <li>
          <a href="#!" className="subheader">
            Logs Section
          </a>
        </li>

        <li>
          <a href="/completedlogs">Completed logs</a>
        </li>


        <li>
          <div className="divider"></div>
        </li>
        <li>
          <a href="#!" className="subheader">
            Techs Sections
          </a>
        </li>
        <li>

          <a href="/team">
            Team
          </a>

        </li>
      </ul>
        </div>
    )
}

export default MobileNav
